import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import {messagesData, usersData} from "./redux/state";
import {posts} from "./redux/state";



ReactDOM.render(
    <App posts={posts}
         usersData={usersData}
         messagesData={messagesData}

    />,
    document.getElementById('root')
);
